import React, { useState } from "react";

function Planner() {
  //States
  const [inputValue, setInputValue] = useState("");
  const [typeOption, setTypeOption] = useState("");
  const [categoryOption, setCategoryOption] = useState("");

  return (
    <div style={{
      display: "flex",
      minHeight: "100vh",
      backgroundColor: "#dbeeff",
      fontFamily: "Arial, sans-serif"
    }}>

      {/* Left Ribbon */}
      <div style={{
        width: "300px",
        backgroundColor: "#003366",
        padding: "20px",
        color: "white",
        display: "flex",
        flexDirection: "column",
        alignItems: "center"
      }}>
        <h2>ENTER A TRANSACTION</h2>

        {/* Transaction Type Dropdown */}
        <select
          value={typeOption}
          onChange={(e) => setTypeOption(e.target.value)}
          style={{
            padding: "10px",
            fontSize: "16px",
            borderRadius: "6px",
            border: "none",
            width: "107%",
            marginBottom: "20px"
          }}
        >
          <option value="">Transaction Type</option>
          <option value="income">Income</option>
          <option value="expense">Expense</option>
        </select>

        {/* Amount */}
        <input
          type="text"
          placeholder="Amount"
          value={inputValue}
          onChange={(e) => setInputValue(e.target.value)}
          style={{
            padding: "10px",
            fontSize: "16px",
            borderRadius: "6px",
            border: "none",
            width: "100%",
            marginBottom: "20px"
          }}
        />

         {/* Category */}
        <select
          value={categoryOption}
          onChange={(e) => setCategoryOption(e.target.value)}
          style={{
            padding: "10px",
            fontSize: "16px",
            borderRadius: "6px",
            border: "none",
            width: "107%",
            marginBottom: "10px"
          }}
        >
          <option value="">Category</option>
          <option value="income">Salary</option>
          <option value="income">Interest</option>
          <option value="income">Bonuses</option>
          <option value="income">Other Income</option>
          <option value="income">Rent</option>
          <option value="expense">Utilities</option>
          <option value="expense">Insurance</option>
          <option value="expense">Health/Medical</option>
          <option value="expense">Education</option>
          <option value="expense">Travel</option>
          <option value="expense">Subscriptions</option>
          <option value="expense">Loan payment</option>
          <option value="expense">Savings</option>
          <option value="expense">Leisure</option>
          <option value="expense">Clothes</option>
          <option value="expense">Food</option>
          <option value="expense">Other Expense</option>
          
        </select>
      </div>

      {/* Main Content Area */}
      <div style={{
        flex: 1,
        padding: "40px",
        textAlign: "center"
      }}>
        <h1>Financial Planner</h1>
        <p>Analytics and charts will go here.</p>
        {inputValue && <p>Input Value: {inputValue}</p>}
      </div>

    </div>
  );
}

export default Planner;
